import Link from "next/link";

const Header = props => {
  return (
    <header className="d-flex flex-column align-center">
      <div>
        <div className="gainz-text d-flex justify-center">GAINZ</div>
        <img className="logo" src="/logo/logo-gainz.png" alt="logo-gainz" />
      </div>
      <nav className="d-flex">
        <Link href="/">
          <a>
            <b>home</b>
          </a>
        </Link>
        <Link href="/paints">
          <a>art</a>
        </Link>
        <a>about</a>
      </nav>
      <style jsx>
        {`
          header {
            width: 100%;
            height: 100px;
            letter-spacing: 2px;
            padding: 20px 40px;
            position: fixed;
            top: 0;
          }
          nav a:not(:last-child) {
            margin-right: 60px;
          }
          .logo {
            width: 180px;
            height: 55px;
            margin-bottom: 20px;
            opacity: 0;
          }
          .gainz-text {
            width: 180px;
            line-height: 5.5rem;
            margin-bottom: 20px;
            font-size: 2rem;
            transition: 0.2s;
          }
          .gainz-text:hover {
            opacity: 0;
            transition: 0.2s;
          }
        `}
      </style>
    </header>
  );
};

export default Header;
